==Loot==
At current [[Grand Exchange]] prices, opening a nature impling jar gives {{Coins|{{ImpValue|nature|jar=yes}} round 0}} worth of loot, on average. This means opening nature impling jars marks an average profit of {{Coins|{{ImpValue|nature|jar=yes}}-{{GEP|Nature impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|100*({{ImpValue|nature|jar=yes}}-{{GEP|Nature impling jar}}) round 0}} to get a [[clue scroll (hard)|hard clue scroll]] from nature impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

